import React, { useEffect } from "react";
import { Navbar, Container, Nav, Form, Button, Dropdown } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import {  useNavigate } from "react-router-dom";
import { currentAdmin, logoutAdmin } from "../../JS/Actions/admin";
import { current, logout } from "../../JS/Actions/user";
import "./NavBar.css";
import logo from "./VERSTAND.png";
import userico from "./user.png";
import out from "./arrow.png";
const NavBar = () => {

  const dispatch = useDispatch();

  useEffect(() => {
    if (localStorage.getItem("token")) {
      dispatch(current());
    }
  }, [dispatch]);

  useEffect(() => {
    if (localStorage.getItem("token")) {
      dispatch(currentAdmin());
    }
  }, [dispatch]);

  const navigate = useNavigate();
  const user = useSelector((state) => state.userReducer.user);
  const isAuth = useSelector((state) => state.userReducer.isAuth);
  const admin = useSelector((state) => state.adminReducer.admin);
  const isAuthAdmin = useSelector((state) => state.adminReducer.isAuthAdmin);
  const isAdmin = useSelector((state) => state.adminReducer.isAdmin);
  
  
 
  return (
    
    <header>
  
      <Navbar bg="light" variant="light" className="NavBar">
        <Container>
          <Navbar.Brand href="/">
            <img
              alt="Verstand"
              src={logo}
              width="50%"
              height="5%"
              className="d-inline-block align-top"
            />{" "}   
          </Navbar.Brand>

          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/AboutUs">About us</Nav.Link>
            <Nav.Link href="/ContactUs">Contact us</Nav.Link>
            <Nav.Link href="/ProductList">Our Products</Nav.Link>
            
            <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-success">Search</Button>
                </Form>
                </Nav>
                <Nav>
            {isAuth ? (
              <div className="logout">
                  <Dropdown>
                    <Dropdown.Toggle
                      className="v11"
                      id="dropdown-basic"
                      variant="secondary"
                    >
                      <span className="v3">
                        {" "}
                        <img
                          src={userico}
                          height="15px"
                          className="userico"
                          alt="img"
                        />{" "}
                        {user && user.name}
                      </span>
                    </Dropdown.Toggle>
                    <Dropdown.Menu>
                      <Dropdown.Item
                        onClick={() => navigate(`/Profile/${user._id}`)}
                      >
                        Your Profile
                      </Dropdown.Item>
                      <Dropdown.Item href="/ProductList">
                        Our Products
                      </Dropdown.Item>
                      <Dropdown.Divider />
                      <Dropdown.Item
                        href="/"
                        onClick={() => dispatch(logout())}
                      >
                        {" "}
                        <img
                          src={out}
                          height="20px"
                          className="userico"
                          alt="img"
                        />
                        Logout
                      </Dropdown.Item>
                    </Dropdown.Menu>
                  </Dropdown>
                </div>
            ) : isAuthAdmin && isAdmin ? (
              <div className="logout">
              <Dropdown>
                <Dropdown.Toggle
                  className="v11"
                  id="dropdown-basic"
                  variant="secondary"
                >
                  <span className="v3">
                    {" "}
                    <img
                      src={userico}
                      height="15px"
                      className="userico"
                      alt="img"
                    />{" "}
                    {admin && admin.name}
                  </span>
                </Dropdown.Toggle>
                <Dropdown.Menu>
                  <Dropdown.Item
                    onClick={() => navigate(`/Profile/${admin._id}`)}
                  >
                    Your Profile
                  </Dropdown.Item>
                  <Dropdown.Item href="/ProductList">
                    Your Products
                  </Dropdown.Item>
                  <Dropdown.Item href="/OrderList">
                    Your Orders
                  </Dropdown.Item>
                  <Dropdown.Item href="/MessageList">
                    Your Messages
                  </Dropdown.Item>
                  <Dropdown.Item href="/UserList">
                    Your Users
                  </Dropdown.Item>
                  <Dropdown.Divider />
                  <Dropdown.Item
                    href="/"
                    onClick={() => dispatch(logoutAdmin())}
                  >
                    {" "}
                    <img
                      src={out}
                      height="20px"
                      className="userico"
                      alt="img"
                    />
                    Logout
                  </Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
            </div>
            ) : (
              <div className="LogRegis">
                <Nav.Link href="/Login">Login</Nav.Link>
                <Nav.Link href="/Register">Register</Nav.Link>
              </div>
            )}
            </Nav>
          
        </Container>
      </Navbar>
    
    </header>
  );
};

export default NavBar;
